export default function Connect() {
  return (
    <section id="connect" className="connect">
      <h2>Connect with Me</h2>
      <ul>
        <li><a href="https://github.com/bradylii" target="_blank" rel="noopener noreferrer">GitHub</a></li>
        <li><a href="https://www.linkedin.com/in/brady-li-78328b23b/" target="_blank" rel="noopener noreferrer">LinkedIn</a></li>
        <li><a href="mailto:you@example.com">Email</a></li>
      </ul>
    </section>
  );
}
